// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/proxy/Clones.sol";
import "./implementations/PodToken.sol";
import "./implementations/CopyrightToken.sol";
import "./implementations/ERC721WithRoyalty.sol";

contract CreationManager {
    bytes32 public constant WITHDRAW_MANAGER_ROLE = keccak256("WITHDRAW_MANAGER_ROLE");
    bytes32 public constant DEFAULT_ADMIN_ROLE = 0x00;
    address private immutable podWithdrawManagerAddress;

    address private immutable podTokenImplementationAddress;
    address private immutable copyrightTokenImplementationAddress;
    address private immutable erc721WithRoyaltyAddress;
    address private podManagerAddress;

    modifier onlyPodManager() {
        require(msg.sender == podManagerAddress, "Only pod manager");
        _;
    }

    /**
     * @notice assign the default roles
     * @param _podTokenImplementationAddress the implementation of the token to clone
     */
    constructor(
        address _podTokenImplementationAddress,
        address _copyrightTokenImplementationAddress,
        address _erc721WithRoyaltyAddress,
        address _podWithdrawManagerAddress
    ) {
        podTokenImplementationAddress = _podTokenImplementationAddress;
        copyrightTokenImplementationAddress = _copyrightTokenImplementationAddress;
        erc721WithRoyaltyAddress = _erc721WithRoyaltyAddress;
        podWithdrawManagerAddress = _podWithdrawManagerAddress;
    }

    function setPodManagerAddress() external {
        require(podManagerAddress == address(0), "Pod manager address already set");
        podManagerAddress = msg.sender;
    }

    function createPodToken(string calldata name, string calldata symbol)
        external
        onlyPodManager
        returns (address)
    {
        address podAddress = Clones.clone(podTokenImplementationAddress);
        PodToken(podAddress).initialize(name, symbol, msg.sender);
        PodToken(podAddress).grantRole(WITHDRAW_MANAGER_ROLE, podWithdrawManagerAddress);
        return (podAddress);
    }

    function createCopyrightToken(
        string calldata name,
        string calldata symbol,
        address[] calldata owners,
        uint256[] calldata copyrightAllocation,
        uint256 copyrightTokenSupply
    ) external onlyPodManager returns (address) {
        address copyrightToken = Clones.clone(copyrightTokenImplementationAddress);
        CopyrightToken(copyrightToken).initialize(name, symbol, msg.sender);
        CopyrightToken(copyrightToken).grantRole(WITHDRAW_MANAGER_ROLE, podWithdrawManagerAddress);
        for (uint256 i = 0; i < owners.length; i += 1) {
            CopyrightToken(copyrightToken).mint(
                owners[i],
                (copyrightAllocation[i] * copyrightTokenSupply) / 100
            );
        }
        CopyrightToken(copyrightToken).mint(
            msg.sender,
            (copyrightAllocation[copyrightAllocation.length - 1] * copyrightTokenSupply) / 100
        );
        return (copyrightToken);
    }

    function createErc721WithRoyalty(
        string calldata name,
        string calldata symbol,
        address podAddress,
        uint256 royaltyPercentage
    ) external onlyPodManager returns (address) {
        address erc721WithRoyalty = Clones.clone(erc721WithRoyaltyAddress);
        ERC721WithRoyalty(erc721WithRoyalty).initialize(name, symbol, podAddress, royaltyPercentage);
        return (erc721WithRoyalty);
    }
}
